void CMaterialDlg::update() {
  if (m_material!=NULL)
  {
  	if (m_workspace!=NULL)
  	{
  		m_workspace->set_changed();
  		m_workspace->redraw();
  	}
  	uchar r, g, b;
  	Fl::get_color(boxColor->color(), r, g, b);
  	m_material->setProperties(
  		edtE->value(),
  		edtG->value(),
  		edtA->value(),
  		edtIy->value(),
  		edtIz->value(),
  		edtKv->value());
  
  	this->setSectionProps(
  		edtWidth->value(),
  		edtHeight->value(),
  		edtUFW->value(),
  		edtLFW->value(),
  		edtWT->value(),
  		edtUFT->value(),
  		edtLFT->value(),
  		edtULFW->value(),
  		edtLLFW->value(),
  		edtOuterRadius->value(),
  		edtInnerRadius->value(),
  		m_sectionType);
  
  	m_material->setColor((int) boxColor->color());
  	m_material->setName((char*)edtName->value());
  }
}

void CMaterialDlg::updateData() {
  this->setSectionProps(
  	edtWidth->value(),
  	edtHeight->value(),
  	edtUFW->value(),
  	edtLFW->value(),
  	edtWT->value(),
  	edtUFT->value(),
  	edtLFT->value(),
  	edtULFW->value(),
  	edtLLFW->value(),
  	edtOuterRadius->value(),
  	edtInnerRadius->value(),
  	m_sectionType);
  
  edtA->deactivate();
  edtIy->deactivate();
  edtIz->deactivate();
  edtKv->deactivate();
  double* tempData;
  m_material->getSection()->getAllData(tempData);
  m_material->getSection()->setAutoCalc(true);
  edtA->value(tempData[1]);
  edtIy->value(tempData[3]);
  edtIz->value(tempData[4]);
  edtKv->value(tempData[5]);
}
